	public class ExecutionReport : Message
	{
		public const string MsgType = "8";

		public ExecutionReport()
		{
			this.Header.SetField(new QuickFix.Fields.BeginString(QuickFix.FixValues.BeginString.FIX41));
			this.Header.SetField(new QuickFix.Fields.MsgType(MsgType));
		}

		public ExecutionReport(
            OrderID aOrderID,
            ExecID aExecID,
            ExecTransType aExecTransType,
            ExecType aExecType,
            OrdStatus aOrdStatus,
            Symbol aSymbol,
            Side aSide,
            OrderQty aOrderQty,
            LastShares aLastShares,
            LastPx aLastPx,
            LeavesQty aLeavesQty,
            CumQty aCumQty,
            AvgPx aAvgPx
                ) : this()
		{
            this.OrderID = aOrderID;
            this.ExecID = aExecID;
            this.ExecTransType = aExecTransType;
            this.ExecType = aExecType;
            this.OrdStatus = aOrdStatus;
            this.Symbol = aSymbol;
            this.Side = aSide;
            this.OrderQty = aOrderQty;
            this.LastShares = aLastShares;
            this.LastPx = aLastPx;
            this.LeavesQty = aLeavesQty;
            this.CumQty = aCumQty;
            this.AvgPx = aAvgPx;
